$_MODULE['<{trustedshopsintegration}prestashop>index_508a8c9f3a8b1c95161c47fad7ae31f8'] = 'Automatyczne maile z prośbą o opinię zgodnie ze statusem zamówienia w PrestaShop';
$_MODULE['<{trustedshopsintegration}prestashop>index_a6a2f6c760db4e38332bdd314ca3ad6c'] = 'Trusted Shops automatycznie wysyła maile z prośbą o opinię 7 dni po tym, jak klient złożył zamówienie. Aktywacja automatycznej wysyłki takich próśb zgodnie ze statusem zamówienia w PrestaShop umożliwia dopasowanie czasu wysyłki do wybranego tu etapu realizacji zamówienia. Jeśli np. wybierzesz status „wysłane“, mail zostanie wysłany dopiero po tym, jak zamówienie wejdzie w ten etap. Umożliwia Ci wysyłanie e-maili z zaproszeniami do klientów w najlepszym możliwym czasie, aby zwiększyć szansę na otrzymanie idealnej opinii.  Należy uwzględnić, iż maile z prośbą o dodanie opinii o zakupie w e-sklepie powinny być wysyłane wyłącznie do klientów, którzy uprzednio wyrazili na to zgodę. Stosowną zgodę należy pozyskać od klienta np. na etapie składania zamówienia w e-sklepie, stosując odpowiedni check box.';
$_MODULE['<{trustedshopsintegration}prestashop>index_076975c124a0edb380d1344e9f83c312'] = 'Wybierz status zamówienia w PrestaShop, [br]żeby wysłać mail z prośbą o opinię w odpowiednim momencie.';
$_MODULE['<{trustedshopsintegration}prestashop>index_99793985ae9e82724fb257b10fe9962a'] = 'Pamiętaj, że aby ta funkcja działała poprawnie, musisz zmienić standardowe ustawienia na Twoim koncie w serwisie My Trusted Shops. Po zalogowaniu wejdź w zakładkę „OpinieUstawieniaZbieranie opinii“ i aktywuj „Review Trigger API“.[br][br] Informacje prawne: Jeśli chcesz wysyłać zapytania o opinie zgodnie z obowiązującym prawem, potrzebujesz zezwolenie swoich klientów na transmisje danych zakupu do Trusted Shops.';
$_MODULE['<{trustedshopsintegration}prestashop>index_baf1cd56252d1a23d5fd63245bb5db66'] = 'Gdyby hasło do konta w serwisie My Trusted Shops zostało zmienione, należy też zmienić swoje hasło w PrestaShop, aby funkcja ta działała poprawnie.';
